import './App.css';

const App = () => {
  const mensaje = "Hola Mundo"
  const a = 5
  const b = 10

  return (
    <div className="App">
     {mensaje + ' Evaluacón en JS'}
     <br />
     {a + b}
     {new Date()}
    </div>
  );
}

export default App;
